export default function sketch (p) {
    p.setup = () => {
        p.createCanvas(600, 400);
    };
    p.draw = () => {
        p.background(0);
        p.fill(250);
        p.ellipse(80, 20, 50, 50);
        p.rect(20, 20, 55, 55);
    };
};
